import Topbar from "./components/Topbar";
import { Routes, Route } from "react-router-dom";
import Todo from "./components/Todo";
import "./App.css";

function App() {
  return (
    <Routes>
      <div className="App">
        <Topbar></Topbar>
        <div className="contentWrapper">
          <Route path="/" element={<Todo />} />
          {/* <Todo /> */}
        </div>
      </div>
    </Routes>
  );
}

export default App;
